    "2016-07-27T22:41:57.007262",nt"name": "development-of-a-stormwater-monitoring-plan-and-geographic-information-system-at-back-bay-",nt"isopen":
    false,nt"url": null,nt"notes": "The initial objective of the Service's
    Back Bay Initiative will be to implement the first phase of a multi-year stormwater
    monitoring study to identify the main sources of sediment and nutrient inputs into
    the bay. A second objective will be to develop a Geographic Information System (GIS)
    database for tracking land use patterns and water quality data in the watershed.
    The use of GIS will support the analysis and identification of water quality problems
    related to land use. Moreover, GIS will be used to identify areas where the Service
    may be able to implement soil conservation practices, commonly known as Best Management
    Practices (BMPs), to be of the most benefit to water quality.",nt"license_title":
